import React from "react";

function HomePage() {
  return (
    <React.Fragment>
      <div>
        <img
          src="images/LandingImage.png"
          alt="Medic"
          style={{ height: "100vh", width: "100%", position: "absolute" }}
        ></img>
      </div>
    </React.Fragment>
  );
}

export default HomePage;
